        public static bool CheckRelativelyPrime(BigInteger num1, BigInteger num2)
        {
            if (num1 < num2)
            {
                var tmp = num1;
                num1 = num2;
                num2 = tmp;
            }
            if (num2 == 1) return true;
            if (num1 % num2 == 0) return false;
            else
            {
                return CheckRelativelyPrime(num2, num1 % num2);
            }
        }
